class RegistrationOfLegalEntities extends Component {

    render() {
        return (
            <div className="wrapper colorBlue">
                <RegistrationOfLegalEntitiesMid props={this.props.props}/>
            </div>
        )
    }
}

export default RegistrationOfLegalEntities
